"use strict";(self.webpackChunkmydatahack_blog_site=self.webpackChunkmydatahack_blog_site||[]).push([[8480],{4948:(e,t,n)=>{n.r(t),n.d(t,{assets:()=>c,contentTitle:()=>i,default:()=>d,frontMatter:()=>r,metadata:()=>a,toc:()=>l});var o=n(74848),s=n(28453);const r={sidebar_position:10},i="",a={id:"Web/Sitecore/custom-goals",title:"custom-goals",description:"Sitecore has out of the box capability to record customers\u2019 behaviours throughout their journey across the channels. We can customise the way to capture customers\u2019 behaviours by registering our own custom events, failure events, goals and outcomes and use them to create personalisation. This out of the box analytics capability is where Sitecore really excels compared to other CMS.",source:"@site/docs/Web/Sitecore/10.custom-goals.md",sourceDirName:"Web/Sitecore",slug:"/Web/Sitecore/custom-goals",permalink:"/mydatahack-old-blog/docs/Web/Sitecore/custom-goals",draft:!1,unlisted:!1,tags:[],version:"current",sidebarPosition:10,frontMatter:{sidebar_position:10},sidebar:"tutorialSidebar",previous:{title:"How to Set up Content Tests with Data Source",permalink:"/mydatahack-old-blog/docs/Web/Sitecore/content-tests-with-datasource"},next:{title:"Using Data Source in Controller Renderings",permalink:"/mydatahack-old-blog/docs/Web/Sitecore/use-data-source-in-controlled-renerings"}},c={},l=[];function g(e){const t={code:"code",h1:"h1",img:"img",p:"p",pre:"pre",...(0,s.R)(),...e.components};return(0,o.jsxs)(o.Fragment,{children:[(0,o.jsx)(t.h1,{id:""}),"\n",(0,o.jsx)(t.p,{children:"Sitecore has out of the box capability to record customers\u2019 behaviours throughout their journey across the channels. We can customise the way to capture customers\u2019 behaviours by registering our own custom events, failure events, goals and outcomes and use them to create personalisation. This out of the box analytics capability is where Sitecore really excels compared to other CMS."}),"\n",(0,o.jsx)(t.p,{children:"Goals are typically set to a page or an action that is defined as a milestone within the sales funnel. For example, getting customer to a selection page is a milestone in the sales funnel where the end goal is conversion. Getting customer to add an item to a card is another milestone that can be captured as a goal."}),"\n",(0,o.jsx)(t.p,{children:"They can be used for profiling and personalising content. If the customer visits more pages related to electronic goods as opposed to kitchen utensils, we can categorise them and create personalised experience on the site accordingly."}),"\n",(0,o.jsx)(t.p,{children:"Another use of goal is to set up AB testing. We can use goal to track say which version of the form triggered submission."}),"\n",(0,o.jsx)(t.p,{children:"In fact the goal set up here will be used for the next post about setting up content tests (How to Set up Content Tests with Data Source)"}),"\n",(0,o.jsx)(t.p,{children:"In this post, we will create a custom goal that can be triggered on form submit event by AJAX when the customer clicks a form submit button. Here are the things we need to do."}),"\n",(0,o.jsx)(t.p,{children:"Create a new goal item and assign a value.\nCreate a service class to register goal.\nCreate an API endpoint that can be used by JavaScript to call AJAX.\nCreate a page with a form.\nTest the solution.\nLet\u2019s get started."}),"\n",(0,o.jsx)(t.p,{children:"Steps"}),"\n",(0,o.jsx)(t.p,{children:"(1) Create a new goal item and assign points"}),"\n",(0,o.jsx)(t.p,{children:"Go to the marketing control panel and add a new goal called SubscriptionFormSubmit. You can assign points that are associated with this goal. I added 11 points."}),"\n",(0,o.jsx)(t.p,{children:(0,o.jsx)(t.img,{alt:"img",src:n(99212).A+"",width:"761",height:"547"})}),"\n",(0,o.jsx)(t.p,{children:"(2) Create a service class to register goal."}),"\n",(0,o.jsx)(t.p,{children:"In the foundation project under Customer, I created the GoalTriggerService, which takes a goal item ID as an argument. This class can be used wherever you want to register a goal."}),"\n",(0,o.jsx)(t.p,{children:"Make sure that you have your Tracker enabled. It is a good idea to add VisitorIdentification tag in the layout, too. Otherwise, Sitecore treats every visitor as a bot. Tracker is enabled by default, but you should check the config file just in case. See how this can be done here, Enabling tacking."}),"\n",(0,o.jsx)(t.p,{children:"Here is the code to register goals."}),"\n",(0,o.jsx)(t.pre,{children:(0,o.jsx)(t.code,{className:"language-csharp",children:'namespace SitecoreDev.Foundation.Customer.Services\n{\n    using Sitecore.Analytics;\n    using Sitecore.Analytics.Data;\n    using Sitecore.Analytics.Data.Items;\n    using Sitecore.Data.Items;\n\n    public class GoalTriggerServices : IGoalTriggerServices\n    {\n        public GoalTriggerServices () { }\n\n        public bool TriggerGoal (ID goalId)\n        {\n            if (Tracker.Enabled)\n            {\n                if (!Tracker.IsActive) Tracker.StartTracking();\n\n                var page = Tracker.Current.Session.Interaction?.PreviousPage;\n                if (page != null)\n                {\n                    Item eventItem = Sitecore.Context.Database.GetItem(goalId);\n\n                    var registeredGoal = new PageEventItem(eventItem);\n                    var eventData = page.Register(registeredGoal);\n                    eventData.Data = eventItem["Description"];\n                    eventData.ItemId = eventItem.ID.Guid;\n                    eventData.DataKey = eventItem.Paths.Path;\n\n                    Tracker.Current.Interaction.AcceptModifications();\n                    return true;\n                }\n            }\n            return false;\n        }\n    }\n}\n'})}),"\n",(0,o.jsx)(t.p,{children:"(3) Create an API endpoint to trigger goal from front end"}),"\n",(0,o.jsx)(t.p,{children:"In Sitecore, we can define a custom route by adding an MVC route, which allows AJAX call to go around the Sitecore render pipeline. This involves creating route map and add some config file. It is a simple thing to do. If you need further information, you should check out the documentation, User MVC routing."}),"\n",(0,o.jsx)(t.p,{children:"In the feature project called Subscription, first add RegisterHttpRoutes.cs in the root."}),"\n",(0,o.jsx)(t.pre,{children:(0,o.jsx)(t.code,{className:"language-csharp",children:'using System.Web.Mvc;\nusing System.Web.Routing;\nusing Sitecore.Pipelines;\n\nnamespace SitecoreDev.Feature.Subscription\n{\n    public class RegisterHttpRoutes\n    {\n        public virtual void Process(PipelineArgs args)\n        {\n            RouteTable.Routes.MapRoute(\n                "TriggerSubscriptionGoal", "Subscription/TriggerSubscriptionGoal",\n                new { controller = "Subscription", action = "TriggerSubscriptionGoal" }\n                );\n        }\n    }\n}\n'})}),"\n",(0,o.jsx)(t.p,{children:"Now we need to register the custom route by adding the processer to the Initialise pipeline. Create a config file, Feature.Subscription.config in App_Config/Include folder as below."}),"\n",(0,o.jsx)(t.pre,{children:(0,o.jsx)(t.code,{className:"language-xml",children:'<configuration xmlns:patch="http://www.sitecore.net/xmlconfig/">\n  <sitecore>\n    <pipelines>\n      <initialize>\n        <processor\n          type="SitecoreDev.Feature.Subscription.RegisterHttpRoutes,SitecoreDev.Feature.Subscription"\n          patch:before="processor[@type=\'Sitecore.Mvc.Pipelines.Loader.InitializeRoutes, Sitecore.Mvc\']"\n         />\n      </initialize>\n    </pipelines>\n  </sitecore>\n</configuration>\n'})}),"\n",(0,o.jsx)(t.p,{children:"The controller is simple. It\u2019s just passing the goal GUID to a GoalTriggerService method created in step 2. The goal can be triggerd by the query string by adding the goal name on the request url. However, registering goals by their GUID is a best practice as adding query parameter with goal name can become flaky."}),"\n",(0,o.jsx)(t.pre,{children:(0,o.jsx)(t.code,{className:"language-csharp",children:'using Sitecore.Data;\nusing Sitecore.Mvc.Controllers;\nusing SitecoreDev.Foundation.Customer.Services;\nusing System.Web.Mvc;\n\nnamespace SitecoreDev.Feature.Subscription.Controllers\n{\n    public class SubscriptionController : SitecoreController\n    {\n        private readonly IGoalTriggerServices goalTriggerServices;\n\n        public SubscriptionController(): this(new GoalTriggerServices()) { }\n\n        public SubscriptionController(IGoalTriggerServices goalTriggerServices)\n        {\n            this.goalTriggerServices = goalTriggerServices;\n        }\n\n        /// <summary>\n        /// Trigger subscription form submit goal\n        /// </summary>\n        /// URL:\n        /// http://local.sakura.com/sitecore/api/Subscription/TriggerSubscriptionGoal\n        [HttpPost]\n        public ActionResult TriggerSubscriptionGoal()\n        {\n            var subscriptionGoalId = new ID("{D5DC0014-1014-4732-90BA-46FB6FB2BB3D}");\n            var goalTriggerdSuccess = this.goalTriggerServices\n                                          .TriggerGoal(subscriptionGoalId);\n            if (goalTriggerdSuccess)\n            {\n                return Json(new { Sucess = true }, JsonRequestBehavior.AllowGet);\n            }\n            return Json(new { Sucess = false }, JsonRequestBehavior.AllowGet);\n        }\n    }\n}\n'})}),"\n",(0,o.jsx)(t.p,{children:"(4) Create a page with a form."}),"\n",(0,o.jsx)(t.p,{children:"Let\u2019s use the page created in the previous post, Using Data Source in Controller Renderings. We can update the JavaScript to add a click event listener to the submit button. Yes, it is a little out of ordinary to use a multiline text field to inject JavaScript. The production solution of course should be something a little bit more robust."}),"\n",(0,o.jsx)(t.pre,{children:(0,o.jsx)(t.code,{className:"language-js",children:'document.addEventListener("DOMContentLoaded", () => {\n  var targetElem = $(document).find(".js-injected");\n  var form = $(`<form>\n      <div class="form-group">\n        <label for="firstname">First name</label>\n        <input type="text" class="form-control" id="firstname"\n                name="firstname" placeholder="Enter firstname">\n      </div>\n      <div class="form-group">\n        <label for="lastname">Last name</label>\n        <input type="text" class="form-control" id="lastname" \n                name="lastname" placeholder="Enter lastname">\n      </div>\n      <div class="form-group">\n        <label for="email">Email</label>\n        <input type="email" class="form-control" id="email" \n                name="email" placeholder="Enter email">\n      </div>\n      <div class="form-check">\n        <input type="checkbox" name="subscribe" \n          class="form-check-input" id="subscribe">\n        <label class="form-check-label" for="subscribe">Subscribe</label>\n      </div>\n      <button type="submit" class="btn btn-danger submit-button">Submit</button>\n    </form>`);\n  form.insertAfter(targetElem);\n\n  // Assigning click event handler\n  $(".submit-button").click((e) => {\n    e.preventDefault();\n    var url = "http://local.sakura.com/Subscription/TriggerSubscriptionGoal";\n    fetch(url, {\n      method: "POST",\n      mode: "no-cors",\n      headers: { "Content-Type": "application/json" },\n      body: "hey",\n    })\n      .then(function (response) {\n        return response.json();\n      })\n      .then(function (json) {\n        return json;\n      })\n      .catch((e) => {\n        console.log(e);\n      });\n  });\n});\n'})}),"\n",(0,o.jsx)(t.p,{children:"(5) Test the solution"}),"\n",(0,o.jsx)(t.p,{children:"You cannot really test this outside of the page context as triggering a goal relies heavily on Sitecore Analytics Tracker. If you use curl to hit the endpoint, the goal registration would not be successful."}),"\n",(0,o.jsx)(t.p,{children:"The best way to test this is to trigger it from the actual page. When you see the network tab, you can see the success message."}),"\n",(0,o.jsx)(t.p,{children:(0,o.jsx)(t.img,{alt:"img",src:n(93577).A+"",width:"468",height:"494"})}),"\n",(0,o.jsx)(t.p,{children:"You can also check it in MongoDB. In the interaction collection, you can see the goal is triggered with the defined points, 11."}),"\n",(0,o.jsx)(t.p,{children:(0,o.jsx)(t.img,{alt:"img",src:n(23854).A+"",width:"684",height:"411"})}),"\n",(0,o.jsx)(t.p,{children:"Yay!"}),"\n",(0,o.jsx)(t.p,{children:"Next steps\nLet\u2019s use this goal to create an AB test. Creating a content test in Sitecore is easy. Check this out: How to Set up Content Tests with Data Source)"}),"\n",(0,o.jsx)(t.p,{children:"(2019-08-14)"})]})}function d(e={}){const{wrapper:t}={...(0,s.R)(),...e.components};return t?(0,o.jsx)(t,{...e,children:(0,o.jsx)(g,{...e})}):g(e)}},99212:(e,t,n)=>{n.d(t,{A:()=>o});const o=n.p+"assets/images/img-1-0e5dbe73fddb95ad36698874a3551845.webp"},93577:(e,t,n)=>{n.d(t,{A:()=>o});const o="data:image/webp;base64,"},23854:(e,t,n)=>{n.d(t,{A:()=>o});const o="data:image/webp;base64,"},28453:(e,t,n)=>{n.d(t,{R:()=>i,x:()=>a});var o=n(96540);const s={},r=o.createContext(s);function i(e){const t=o.useContext(r);return o.useMemo((function(){return"function"==typeof e?e(t):{...t,...e}}),[t,e])}function a(e){let t;return t=e.disableParentContext?"function"==typeof e.components?e.components(s):e.components||s:i(e.components),o.createElement(r.Provider,{value:t},e.children)}}}]);